  \"2015-09-27T00:50:26.923965\",\n\t\"name\": \"temperature-salinity-dissolved-oxygen-fluorometer-and-other-data-collected-with-ctd-casts-durin\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is the final processed data for the
  following cruises in the northeastern Pacific Ocean, Strait of Juan De Fuca, and
  Puget Sound from 20030602 to 20061004: 1. ECOHAB/PNW1 aboard the Wecoma (W0306a),
  2. ECOHAB/PNW2 aboard the Wecoma (W0308c), 3. ECOHAB/PNW3 aboard the Atlantis (AN1117),
  4. ECOHAB/PNW4 aboard the Atlantis (AN1130), 5. ECOHAB/PNW5 aboard the R/V Melville
  (8M0509), and 6. ECOHAB/PNW6 aboard the R/V Thomas G. Thompson (TN200). These data
  were collected using the ships' SBE911+ system with dual Temperature and Conductivity
  sensors, a Chelsea/SeaTech/Wetlabs (Cstar/ECO-(AFL/FL)) fluorometer sensor, Chelsea/Wetlabs
  Cstar Transmissometer, a Biospherical Instruments/LICOR PAR (Irradiance) sensor,
  and a Sea Bird SBE043 dissolved oxygen sensor. The data was initially processed
  using SeaBird Electronics' processing with SeaBird's standard. recommended parameters.
  The procedure used for quality-control and calibration post processing follows that
  developed at NOAA's Pacific Marine Environmental Laboratory in the Eco-FOCI (Fisheries
  and Oceanography coordinated Investigations) and other in house procedures. (NODC
  Accession 0049079)\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
